import React, {useState} from 'react'
import './App.css';

function App() {

const [message,setMessage] = useState('')

const generateMessage = async () => {
  try{
    const response = await fetch('/generate-message')
    const data = await response.text();
    console.log(message)
    setMessage(data)
  } catch(error){
    console.error('Error fetchong message', error)
  }
}


  return (
    <div className="App">
      <h1>Generate Thank You Message</h1>
      <button onClick={generateMessage}>Generate Message</button>
<p>{message}</p>   
    </div>
  );
}

export default App;
